import Banner from "../components/Banner";
import BoxArticle from "../components/BoxArticle";
import DashboardFooter from "../components/DashboardFooter";
import DashboardItems from "../components/DashboardItems";
import TextLabel from "../components/TextLabel";
import bannerImage from "../images/b1.jpg";
import "./Dashboard.css";
let Dashboard = () => {
  const items = [
    {
      imagePath: "img/img-3x2-01.jpg",
      title: "Best collection",
      desc: " Aliquam purus arcu, congue a gravida ac, facilisis vel erat. Maecenas pretium sem.",
    },
    {
      imagePath: "img/img-3x2-02.jpg",
      title: "Test school",
      desc: " Aliquam purus arcu, congue a gravida ac, facilisis vel erat. Maecenas pretium sem.",
    },
    {
      imagePath: "img/img-3x2-03.jpg",
      title: "New Design for your website",
      desc: " Aliquam purus arcu, congue a gravida ac, facilisis vel erat. Maecenas pretium sem.",
    },
    {
      imagePath: "img/img-3x2-04.jpg",
      title: "Simple touch",
      desc: " Aliquam purus arcu, congue a gravida ac, facilisis vel erat. Maecenas pretium sem.",
    },
  ];
  const itemsBoxArticle = [
    {
      imagePath: "fas fa-3x fa-binoculars tm-article-icon",
      title: "Template Usage",
      desc: "You can feel free to edit and use New Vision template for your commercial websites.",
    },
    {
      imagePath: "fas fa-3x fa-microscope tm-article-icon",
      title: "New Vision",
      desc: "Comes with 4 different HTML pages and provided free of charge by TemplateMo. ",
    },
    {
      imagePath: "fas fa-3x fa-glasses tm-article-icon",
      title: "Download Sites",
      desc: "  Do not re-distribute our template ZIP file on your website. Or contact us first.",
    },
  ];
  return (
    <div>
      <div className="container-fluid">
        <Banner bannerId="tm-main-bg" />

        <main>
          <section className="tm-welcome">
            <TextLabel name="Welcome to Turkey" />

            <div className="row tm-welcome-row">
              <DashboardItems data={items[0]} />
              <DashboardItems data={items[1]} />
              <DashboardItems data={items[2]} />
              <DashboardItems data={items[3]} />
            </div>

            <div className="row tm-welcome-row-2">
              <BoxArticle data={itemsBoxArticle[0]} />
              <BoxArticle data={itemsBoxArticle[1]} />
              <BoxArticle data={itemsBoxArticle[2]} />
            </div>
          </section>

          <DashboardFooter />
        </main>
      </div>
    </div>
  );
};

export default Dashboard;
